import config  from "../config";
import { useState } from "react"
import { Contact } from "../Types/contact"

const ContactList = () => 
{
    const [contact, setcontact] = useState<Contact[]>([]);
    const fetchContact = async () => 
    {
        const rsp = await fetch("https://localhost:4000/contact");
        const contacts = await rsp.json();
        setcontact(contacts);
    };
    fetchContact();
    return(
        <div>
            <div>
                <h5 className= "themeFontColor text-center ">
                    Lists
                    <br></br>
                    <br></br>

                </h5>
            </div>
            <table className = " table table-hover ">
                <thead>
                    <tr> 
                        <th>FirstName</th>
                        <th>LastName</th>
                        <th>Email</th>
                        <th>PhoneNumber</th>
                    </tr>
                </thead>
                <tbody>
                    {contact.map((h) => 
                    (
                        <tr key = {h.Id}>

                            <td>{h.firstName}</td>
                            <td>{h.LastName}</td>
                            <td>{h.Email}</td>
                            <td>{h.PhoneNumber}</td>

                        </tr>
                    ))}
                </tbody>

            </table>
        </div>


    )

}
export default ContactList;
